package examPrep;

import java.util.Scanner;

public class P04PCGameShop {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int n = Integer.parseInt(scanner.nextLine());

        int hearthstoneCount = 0;
        int forniteCount = 0;
        int overwatchCount = 0;
        int otherCount = 0;
        for (int i = 1; i <= n; i++) {
            String gameName = scanner.nextLine();

            switch (gameName) {
                case "Hearthstone":
                    hearthstoneCount++;
                    break;
                case "Fornite":
                    forniteCount++;
                    break;
                case "Overwatch":
                    overwatchCount++;
                    break;
                default:
                    otherCount++;
            }
        }

        System.out.printf("Hearthstone - %.2f%%%n", hearthstoneCount * 1.0 / n * 100);
        System.out.printf("Fornite - %.2f%%%n", forniteCount * 1.0 / n * 100);
        System.out.printf("Overwatch - %.2f%%%n", overwatchCount * 1.0 / n * 100);
        System.out.printf("Others - %.2f%%%n", otherCount * 1.0 / n * 100);
    }
}

#include <bits/stdc++.h>

using namespace std;

int n = 4, m = 7;
// 0, 1, 2, 3 - 1 part
// 4, 5, 6, 7, 8, 9, 10 - 2 part

vector<vector<int>> g(n + m, vector<int> ());
vector<int> p(n + m, -1);
vector<int> used(n + m);

bool dfs(int v) {
    if (used[v]) {
        return false;
    }
    used[v] = 1;
    for (int to : g[v]) {
        if (p[to] == -1) {
            p[v] = to;
            p[to] = v;
            return true;
        }
    }
    for (int to : g[v]) {
        if (dfs(p[to])) {
            p[v] = to;
            p[to] = v;
            return true;
        }
    }
    return false;
}

int max_matching() {
    // V = n + m, E, O(V + E)
    // O(n * (V + E))
    for (int it = 0; ; ++it) {
        fill(used.begin(), used.end(), 0);
        bool found_path = false;
        for (int i = 0; i < n; ++i) {
            if (p[i] == -1) {
                if (dfs(i)) {
                    found_path = true;
                    break;
                }
            }
        }
        if (!found_path) {
            return it;
        }
    }
}

int max_matching_v2() {
    // O(n * (V + E)) 5000
    int matching = 0;
    for (int i = 0; i < n; ++i) {
        if (p[i] == -1) {
            if (dfs(i)) {
                fill(used.begin(), used.end(), 0);
                ++matching;
            }
        }
    }
    return matching;
}

int matching_v3() {
    // n, m, E <= 10^5
    int matching = 0;
    for (int it = 0; ; ++it) {
        fill(used.begin(), used.end(), 0);
        bool found_path = false;
        for (int i = 0; i < n; ++i) {
            if (p[i] == -1) {
                if (dfs(i)) {
                    found_path = true;
                    ++matching;
                }
            }
        }
        if (!found_path) {
            return matching;
        }
    }
}

