package examPrep;

import java.util.Scanner;

public class P03MobileOperator {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        String yearContract = scanner.nextLine();
        String typeContract = scanner.nextLine();
        String mobileNet = scanner.nextLine();
        int months = Integer.parseInt(scanner.nextLine());
        
        double amount = 0;
        if (yearContract.equals("one")) {
            if (typeContract.equals("Small")) {
                amount = 9.98;
            } else if (typeContract.equals("Middle")) {
                amount = 18.99;
            } else if (typeContract.equals("Large")) {
                amount = 25.98;
            } else if (typeContract.equals("ExtraLarge")) {
                amount = 35.99;
            }
        } else if (yearContract.equals("two")) {
            if (typeContract.equals("Small")) {
                amount = 8.58;
            } else if (typeContract.equals("Middle")) {
                amount = 17.09;
            } else if (typeContract.equals("Large")) {
                amount = 23.59;
            } else if (typeContract.equals("ExtraLarge")) {
                amount = 31.79;
            }
        }

        if (mobileNet.equals("yes")) {
            if (amount <= 10) {
                amount = amount + 5.50;
            } else if (amount <= 30) {
                amount = amount + 4.35;
            } else {
                amount = amount + 3.85;
            }
        }

        double totalSum = amount * months;

        if (yearContract.equals("two")) {
            totalSum = totalSum - (totalSum * 0.0375);
        }

        System.out.printf("%.2f lv.%n", totalSum);
    }
}

package examPrep;

import java.util.Scanner;

public class P02FootballResults {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int countWon = 0;
        int countLost = 0;
        int countTie = 0;
        for (int i = 0; i < 3; i++) {
            String gameResult = scanner.nextLine();

            char firstPoints = gameResult.charAt(0);
            char secondPoints = gameResult.charAt(2);

            if (firstPoints > secondPoints) {
                countWon++;
            } else if (firstPoints < secondPoints) {
                countLost++;
            } else {
                countTie++;
            }
        }

        System.out.printf("Team won %d games.%n", countWon);
        System.out.printf("Team lost %d games.%n", countLost);
        System.out.printf("Drawn games: %d%n", countTie);


    }
}

package examPrep;

import java.util.Scanner;

public class P01EasterLunch {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int cakeCount = Integer.parseInt(scanner.nextLine());
        int eggsCount = Integer.parseInt(scanner.nextLine());
        int cookiesCount = Integer.parseInt(scanner.nextLine());

        double cakePrice = cakeCount * 3.20;
        double eggsPrice = eggsCount * 4.35;
        double cookiesPrice = cookiesCount * 5.40;
        double paintEggsPrice = eggsCount * 12 * 0.15;

        double totalSum = cakePrice + eggsPrice + cookiesPrice + paintEggsPrice;

        System.out.printf("%.2f", totalSum);
    }
}

