  int i = 0; 
  char str[100] = "";
  if(Serial.available()){
    c = Serial.read();
    switch(c){
      case 'P':case 'p':
        while(Serial.available()){
          Serial.read();
        }
        while(!Serial.available()){ }
        c = Serial.read();
        i = 0; 
        while((c != 32) &&(Serial.available())){
          str[i] = c;
          i++;
          c = Serial.read();
        }
        for(int j = 0 ; j < i ; j++){
          Serial.print(str[i]);
        }
        Serial.println(i);
        Serial.println("END");
    }
  }
    
